schema:
{
 "description": "APLogConfSpec defines the desired state of APLogConf",
 "properties": {
  "content": {
   "properties": {
    "format": {
     "enum": [
      "splunk",
      "arcsight",
      "default",
      "user-defined"
     ],
     "type": "string"
    },
    "format_string": {
     "type": "string"
    },
    "max_message_size": {
     "pattern": "^([1-9]|[1-5][0-9]|6[0-4])k$",
     "type": "string"
    },
    "max_request_size": {
     "pattern": "^([1-9]|[1-9][0-9]|[1-9][0-9]{2}|1[0-9]{3}|20[1-3][0-9]|204[1-8]|any)$",
     "type": "string"
    }
   },
   "type": "object"
  },
  "filter": {
   "properties": {
    "request_type": {
     "enum": [
      "all",
      "illegal",
      "blocked"
     ],
     "type": "string"
    }
   },
   "type": "object"
  }
 },
 "title": "AP Log Conf",
 "type": "object"
}
